  false,\n\t\"url\": null,\n\t\"notes\": \"This coverage contains estimates of agricultural
  cropping-practices in counties in the conterminous United States as reported in
  the 1987 Census of Agriculture (U.S. Department of Commerce, 1989a). Agricultural
  cropping-practice data are reported as either acres, or as a percentage of county
  area. Agricultural cropping-practice estimates were generated from surveys of all
  farms where $1,000 or more of agricultural products were sold, or normally would
  have been sold, during the census year. Most of the attributes summarized represent
  1987 data, but some information for the 1982 Census of Agriculture also was included.
  The polygons representing county boundaries in the conterminous United States, as
  well as lakes, estuaries, and other nonland-area features were derived from the
  Digital Line Graph (DLG) files representing the 1:2,000,000-scale map in the National
  Atlas of the United States (1970). crops Agricultural cropping-practices Census
  of Agriculture Counties United States\",\n\t\"license_title\": null,\n\t\"extras\":
